import React from 'react';

import Block from './Block';
import Transaction from './Transaction';
import Where from './Where';
// import Testimonial from './Testimonial';

import Mymodal from './Buttons/Mymodal';

class Body extends React.Component {
// function Body(props) {
    constructor(props) {
        super(props);

    }
    componentWillMount() {
        console.log(this.state,"virat will")
    }
    componentDidMount() {
        console.log(this.state,"virat did")
    }

    render() {
        return (
            <div>
                <Block onclickevent={this.props.onclickevent} />
                <Transaction onclickevent={this.props.onclickevent} />
                <Where />
                {/* <Testimonial />         */}
                <Mymodal type={this.props.type} />
            </div>
        );
    }
}

export default Body;
